import React from 'react';

const Errorpage = () => {
    return (
        <>
        <div style={{height: "70vh"}}>
            <center>
                <h1 className='my-5'>404!</h1>
                <h4>You are lost!</h4>
            </center>
        </div>
        </>
    );
}

export default Errorpage;
